import React, { Component } from "react";
import { connect } from "react-redux";
import PropTypes from "prop-types";
import { getDocument } from "../actions/DocumentActions";

class Dashboard extends Component {
  componentDidMount() {
    const { documentId } = this.props.match.params;
    this.props.getDocument(documentId, this.props.history);
  }
  constructor() {
    super();
    this.state = {
      documentId: "",
      subject: "",
      topic: "",
      subTopic: "",
      content: ""
    };
  }



  render() {
    return (
      <div className="container bg-warning">
        <div className="col-md-12">
        <h1 className="display-4 text-center">Documents</h1>
        <h1 className="display-4 text-center">topic:{document.topic}{this.props.topic}</h1>
        </div>
      </div>
    );
  }
}
Dashboard.propTypes = {
  getDocument: PropTypes.func.isRequired,
  document: PropTypes.object.isRequired
};

const mapStateToProps = state => ({
  document: state.documents.document
});
export default connect(
  mapStateToProps,
  { getDocument}
)(Dashboard);
